import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Todos from "./Todos";
import Todo from "./Todo";


function App() {
    return (
        <div>
            <Header />
            <Todos />
            <Todo />

            <Footer />
        </div>
    );
}

export default App;
